import React from "react";
import { Link } from "react-router-dom";
import email from "../../assets/email.png";

const Navfooter = () => {
  return (
    <div className="headerlogo">
      <img src={email} className="email" href="mailto:commeospa07@gmail.comcom"
            alt="lien pour m'envoyer un email" />
      <nav className="footernav">
        <a className="linkfooter" href="/Flyer.pdf" target="_blank">Télécharger ma carte de visite</a>
        <Link to="/Mentions" className="linkfooter">Mentions légales</Link>
      </nav>
    </div>
  );
};

export default Navfooter;
